import React from 'react';

export default class Layout extends React.Component {
    handleChange(e) {
        const title = e.target.value;

    }
    render() {
        return (
            <div>
                <h1> Hello World </h1>
                <input onChange={this.handleChange.bind(this)} />
            </div>

        );
    };

}
